import React from 'react';

const Sidebar = () => {
  return (
    <div className="sidebar">
      <h2>ChatBot</h2>
      <ul>
        <li>Chat History 1</li>
        <li>Chat History 2</li>
        <li>Settings</li>
      </ul>
    </div>
  );
};

export default Sidebar;
